const carbone = require('../lib');
const fs = require('fs');

const dataDOCXImage = {
  image: 'data:image/png;base64,'
};

carbone.render('image.docx', dataDOCXImage, function (err, result) {
  if (err) {
    return console.log(err);
  }
  // write the result
  fs.writeFileSync('resultImage.docx', result);
});

